function DisableOnClassBehavior(c,a,b){id=c+"_"+a+"_"+b;if(typeof enableMap==="undefined"){enableMap=new Object()}if(typeof enableMap[b]==="undefined"){enableMap[b]=true}if(typeof DisableOnClassCallId==="undefined"){DisableOnClassCallId=new Object()}if(typeof DisableOnClassCallId[id]!=="undefined"){return}callid=setInterval(function(){var d=jQuery("#"+c).attr("class").split(" ");var e=0;for(i=0;i<d.length;i++){if(d[i]===a){e++}}if(!e){enableMap[b]=true}else{enableMap[b]=false}},100);DisableOnClassCallId[id]=callid};